"use strict";(globalThis.webpackChunkai_book=globalThis.webpackChunkai_book||[]).push([[156],{3766:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","href":"/Physical-AI-Humanoid-Robotics-With-Chatbot/docs/","label":"Introduction","docId":"introduction","unlisted":false},{"type":"link","href":"/Physical-AI-Humanoid-Robotics-With-Chatbot/docs/01-ros2","label":"ROS 2","docId":"01-ros2","unlisted":false},{"type":"link","href":"/Physical-AI-Humanoid-Robotics-With-Chatbot/docs/02-gazebo-unity","label":"Digital Twin","docId":"02-gazebo-unity","unlisted":false},{"type":"link","href":"/Physical-AI-Humanoid-Robotics-With-Chatbot/docs/03-isaac","label":"NVIDIA Isaac","docId":"03-isaac","unlisted":false},{"type":"link","href":"/Physical-AI-Humanoid-Robotics-With-Chatbot/docs/04-vla","label":"VLA","docId":"04-vla","unlisted":false},{"type":"link","href":"/Physical-AI-Humanoid-Robotics-With-Chatbot/docs/05-capstone","label":"Capstone","docId":"05-capstone","unlisted":false},{"type":"link","href":"/Physical-AI-Humanoid-Robotics-With-Chatbot/docs/06-references","label":"References","docId":"06-references","unlisted":false}]},"docs":{"01-ros2":{"id":"01-ros2","title":"Chapter 1 - The Robotic Nervous System (ROS 2)","description":"Welcome to Chapter 1: The Robotic Nervous System (ROS 2). In this chapter, we delve into the fundamentals of the Robot Operating System 2 (ROS 2), a flexible framework for writing robot software. ROS 2 provides libraries and tools to help software developers create robot applications. It is widely used in research and industry due to its modular design, extensive community support, and robust communication infrastructure.","sidebar":"tutorialSidebar"},"02-gazebo-unity":{"id":"02-gazebo-unity","title":"Chapter 2 - The Digital Twin (Gazebo & Unity)","description":"Welcome to Chapter 2 Gazebo and Unity. Digital twins are virtual models of physical systems, allowing for simulation, testing, and development in a safe and controlled environment. The use of digital twins has become an indispensable part of modern robotics development, enabling rapid prototyping and robust testing of complex robotic systems.","sidebar":"tutorialSidebar"},"03-isaac":{"id":"03-isaac","title":"Chapter 3 - The AI-Robot Brain (NVIDIA Isaac)","description":"Welcome to Chapter 3: The AI-Robot Brain (NVIDIA Isaac). This chapter introduces NVIDIA Isaac, a powerful platform for developing, testing, and deploying AI-powered robots. Isaac combines high-fidelity simulation, a rich set of robotics algorithms, and an accelerated computing architecture to enable advanced robotic applications. The Isaac ecosystem is designed to streamline the entire robotics development workflow, from simulation and training to deployment and management.","sidebar":"tutorialSidebar"},"04-vla":{"id":"04-vla","title":"Chapter 4 - Vision-Language-Action (VLA)","description":"Welcome to Chapter 4: Vision-Language-Action (VLA). This chapter explores the exciting field of Vision-Language-Action (VLA), where robots leverage large language models (LLMs) and advanced perception to understand natural language commands and execute complex tasks in the physical world. This integration bridges the gap between human intent and robotic execution, leading to more intuitive and versatile robotic systems.","sidebar":"tutorialSidebar"},"05-capstone":{"id":"05-capstone","title":"Chapter 5 - Capstone: The Autonomous Humanoid","description":"Welcome to the capstone chapter. Here we bring together all the concepts from the previous chapters to build a complete system for an autonomous humanoid robot. This chapter serves as a culmination of your learning, guiding you through the process of designing, integrating, and evaluating a complex robotic system. We will transition from theoretical knowledge to a practical (though conceptual) implementation, providing a blueprint for how you might approach such a project in the real world.","sidebar":"tutorialSidebar"},"06-references":{"id":"06-references","title":"Chapter 6 - References, Glossary & Further Reading","description":"Welcome to Chapter 6: References, Glossary & Further Reading. This chapter provides a curated list of resources, defines key terminology used throughout the textbook, and suggests avenues for advanced study. Continuous learning and exploration are vital in the rapidly evolving fields of Physical AI and robotics.","sidebar":"tutorialSidebar"},"introduction":{"id":"introduction","title":"Introduction","description":"Welcome to \\"Physical AI & Humanoid Robotics,\\" a comprehensive Docusaurus textbook designed for higher education students. This book delves into the fascinating convergence of artificial intelligence with robotic systems, offering practical insights and code examples across key modules.","sidebar":"tutorialSidebar"},"tutorial-basics/congratulations":{"id":"tutorial-basics/congratulations","title":"Congratulations!","description":"You have just learned the basics of Docusaurus and made some changes to the initial template."},"tutorial-basics/create-a-blog-post":{"id":"tutorial-basics/create-a-blog-post","title":"Create a Blog Post","description":"Docusaurus creates a page for each blog post, but also a blog index page, a tag system, an RSS feed..."},"tutorial-basics/create-a-document":{"id":"tutorial-basics/create-a-document","title":"Create a Document","description":"Documents are groups of pages connected through:"},"tutorial-basics/create-a-page":{"id":"tutorial-basics/create-a-page","title":"Create a Page","description":"Add Markdown or React files to src/pages to create a standalone page:"},"tutorial-basics/deploy-your-site":{"id":"tutorial-basics/deploy-your-site","title":"Deploy your site","description":"Docusaurus is a static-site-generator (also called Jamstack)."},"tutorial-basics/markdown-features":{"id":"tutorial-basics/markdown-features","title":"Markdown Features","description":"Docusaurus supports Markdown and a few additional features."},"tutorial-extras/manage-docs-versions":{"id":"tutorial-extras/manage-docs-versions","title":"Manage Docs Versions","description":"Docusaurus can manage multiple versions of your docs."},"tutorial-extras/translate-your-site":{"id":"tutorial-extras/translate-your-site","title":"Translate your site","description":"Let\'s translate docs/intro.md to French."}}}}')}}]);